import React, { useState, useEffect } from 'react'
import data from './../../data/data'

export default function Dashboard() {
    return (
        <div>
            {data}
            <ul>
            {data.map(el => {
                return (
                    <li>
                        {el}
                    </li>
                )
            })}
            </ul>
        </div>
    )
}
